import Projects from './components/Projects.js';
import Footer from './components/Footer.js';

const App = () => {
  return (
      <div className="App">
          <Header>
              <Navbar></Navbar>
              <div className="Title-Container">     {/* TODO: REFACTOR THIS */}
                  <h1 className="Ttile"><span id={"Winston"}>Winston</span> John Reichelt</h1>
              </div>
          </Header>

          <main>
        <About></About>
        <Projects></Projects>
